import React, { useState } from "react";
import { Input, Row, Col, Card, Typography, Button } from "antd";

// card
const { Title } = Typography;

function App() {
  return (
    <div className="App">
      <Row justify="center">
        <Col span={24}>
          <Card style={{ height: 100 }}>
            <Title level={1}>Weather App</Title>
          </Card>
        </Col>
      </Row>
      <br />
      <br />
      <Row justify="center">
        <Col span={24}>
        <Input placeholder="Enter the city name" size="large" style={{width:400}}/>
        </Col>
      </Row>
    </div>
  );
}

export default App;
